function getInstagramFeed(){var e=window.location.hash.substr(1),s=e.replace(/access_token=/g,""),a=s.split("."),n=a[0];if(s){var c=new Instafeed({get:"user",userId:n,clientId:"3f82142d11d34cef993bfb28ed7999bf",accessToken:s,template:'<div class="columns small-24 large-8"><div class="instafeed__item"><a href="{{link}}"><img src="{{image}}" /></a><div class="instafeed__content"><span>{{likes}} likes</span><p>{{caption}}</p></div></div></div>',after:function(){console.log("after")},success:function(){console.log("success")}});c.run()}}getInstagramFeed();